    max,
    factor
  },
}) => {

  return (
    <Fragment>

      <tr>
        <td>{ exercise }</td>
        <td>{ min }</td>
        <td>{ max }</td>
      </tr>
    </Fragment>
  );
};

export default connect(null)(ExerciseItem);
